Dioxus is a declarative framework. This means that instead of telling Dioxus what to do (e.g. to "create an element" or "set the color to red") we simply declare what we want the UI to look like using RSX. You have already seen a simple example of RSX syntax in the "hello world" application: // define a component that renders a div with the text "Hello, world!"
fn App(cx: Scope) -> Element { cx.render(rsx! { div { "Hello, world!" } })
} Here, we use the rsx! macro to declare that we want a div element, containing the text "Hello, world!". Dioxus takes the RSX and constructs a UI from it.

