Component props are a single struct annotated with #[derive(Props)]. For a component to accept props, the type of its argument must be Scope<YourPropsStruct>. Then, you can access the value of the props using cx.props. There are 2 flavors of Props structs: Owned props: Don't have an associated lifetime Implement PartialEq, allow for memoization (if the props don't change, Dioxus won't re-render the component) Borrowed props: Borrow from a parent component Cannot be memoized due to lifetime constraints Owned Props Owned Props are very simple – they don't borrow anything. Example: // Remember: Owned props must implement `PartialEq`!
#[derive(PartialEq, Props)]
struct LikesProps { score: i32,
} fn Likes(cx: Scope<LikesProps>) -> Element { cx.render(rsx! { div { "This post has ", b { "{cx.props.score}" }, " likes" } })
